import React, { Component } from 'react';
import { Bills } from '../../Fetches/Queries';

class Reports extends Component {
  constructor() {
    super();
    this.state = {
      bill: '',
      keys: '',
      selected: ''
    };
    this.fetchBill = this.fetchBill.bind();
  }
  fetchBill = async () => {
    let a = await Bills();
    await this.setState({ bill: a, keys: a.map(i => Object.keys(i)[0]) });
  };
  componentDidMount() {
    this.fetchBill();
  }
  render() {
    return (
      <div>
        {this.state.keys && (
          <ul>
            {this.state.keys.forEach(i => (
              <li>{i}</li>
            ))}
          </ul>
        )}
        hi
      </div>
    );
  }
}

export default Reports;
